import { Col, Image } from "react-bootstrap"

export const UserProfile = (user) => {
    return (
        <Col key={user.id} xs={4} >
            <div className="userImageContainer">
                <Image
                    className='userImage'
                    src={user.path}
                    alt={user.name}
                    roundedCircle
                />
                
            </div>
            <h2>{user.name}</h2>
        </Col>
    )
}
